import React from 'react';
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import InfoArea from "components/InfoArea/InfoArea.js";
import CardBody from "components/Card/CardBody.js";




function Conteudo() {
  return (
   
    <div>
        <GridContainer>
            <GridItem
              xs={12}
              sm={8}
              md={8}
              className={
                classes.mlAuto + " " + classes.mrAuto + " " + classes.textCenter
              }
            >
              <h2 className={classes.title}>
                Distribuidoras
              </h2>
              <h5 className={classes.description}>
                Conheça sua distribuidora nos minimos detalhes, gerencie e controle operações em poucos clicks.
              </h5>
              <div className={classes.sectionSpace} />
            </GridItem>
          </GridContainer>
          <GridContainer>
            <GridItem xs={12} sm={5} md={5} className={classes.mlAuto}>
              <Card
                background
                className={classes.card4}
                style={{ backgroundImage: `url(${cardProject2})` }}
              >
                <CardBody background className={classes.cardBody4}>
                  <a href="#pablo" onClick={e => e.preventDefault}>
                    <h3 className={classes.cardTitle}>Beautiful Project</h3>
                    <p className={classes.cardDescription}>
                      Don{"'"}t be scared of the truth because we need to
                      restart the human foundation in truth.
                    </p>
                  </a>
                </CardBody>
              </Card>
            </GridItem>
            <GridItem xs={12} sm={5} md={5} className={classes.mrAuto}>
              <InfoArea
                className={classes.info4}
                title="Aplicativo Força de Venda"
                description="Potencialize suas vesndas de forama facil e rapida na palma da mão!
                Com ultilização do APP Dingo! o processo é  totalmente automatizado eo aumento de venda pode chegar em 20%."
                icon={FormatPaint}
                iconColor="info"
              />
              <InfoArea
                className={classes.info4}
                title="Modulo de Compras"
                description="A gestão de compras é fundamental para qualquer empresa. Gerenciamos as compras de insumos , materias primas
                 e produtos acabados através de status desde o pedido até entrada em estoque."
                icon={Code}
                iconColor="primary"
              />
              <InfoArea
                className={classes.info4}
                title="Recursos disponiveis:"
                description="Ordem de compra .Integração com a entrada de nota .Envio personalizado de ordem de compra .Gerencialmento por centro de 
                custo .Controle de estoque X estoque minimo .Efetivação total e parcial .Gerencimento de tabela de preços ."
                icon={Dashboard}
                iconColor="danger"
              />
              
            </GridItem>
          </GridContainer>
    </div>
    
  );
}

export default Conteudo;
